// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

contract Bank {
  struct DepositInfo {
    address depositor;
    uint256 amount;
    uint256 timestamp;
  }

  struct DepositRank {
    address depositor;
    uint256 amount;
  }

  address public admin;
  // 记录每个地址的存款金额
  mapping(address => uint256) public deposits;
  // 前三名存款用户的地址和金额
  address[3] public topDepositors;
  uint256[3] public topAmounts;

  DepositInfo[] public allDeposits;


  constructor(address _admin) {
    admin = _admin;
  }
  // 接收存款的函数
  receive() external payable {
    deposits[msg.sender] += msg.value;
    allDeposits.push(DepositInfo(msg.sender, deposits[msg.sender], block.timestamp));
    updateTopDepositors(msg.sender);
  }

    // 更新前三名存款用户
  function updateTopDepositors(address depositor) private {
      uint256 amount = deposits[depositor];

      for (uint i = 0; i < 3; i++) {
          if (amount > topAmounts[i]) {
              // 将现有元素后移
              for (uint j = 2; j > i; j--) {
                  topAmounts[j] = topAmounts[j-1];
                  topDepositors[j] = topDepositors[j-1];
              }
              // 插入新元素
              topAmounts[i] = amount;
              topDepositors[i] = depositor;
              break;
          }
      }
  }
  // 管理员提取资金
  function withdraw(uint256 amount) external {
    require(msg.sender == admin, "Only admin can withdraw");
    require(amount <= address(this).balance, "Insufficient balance");
    payable(admin).transfer(amount);
  }
  // 查看合约余额
  function getBalance() external view returns (uint256) {
    return address(this).balance;
  }

  // 查看前三名余额用户
  function getTopDepositors() external view returns (address[3] memory, uint256[3] memory) {
    return (topDepositors, topAmounts);
  }

  // function getDeposits() external view returns (mapping memory) {
  //   return deposits;
  // }
  // 获取所有存款记录
  function getAllDeposits() external view returns (DepositInfo[] memory) {
    return allDeposits;
  }

  function getSortedDeposits() external view returns (DepositRank[] memory) {

    // 计算有效存款地址的数量
    uint256 count = 0;

    for (uint i = 0; i<allDeposits.length; i++) {
      if (deposits[allDeposits[i].depositor] > 0) {
        count +=1;
      }
    }

    // 创建临时数组存储所有非零存款记录
    DepositRank[] memory depositRanks = new DepositRank[](count);
    uint256 index = 0;
    // 填充数组
    for (uint i = 0; i < allDeposits.length; i++) {
      address depositor = allDeposits[i].depositor;
      uint256 amount = deposits[depositor];

      if (amount > 0) {
        depositRanks[index] = DepositRank(depositor, amount);
        index++;
      }
    }

    // 冒泡排序，从大到小
    for(uint i = 0; i < depositRanks.length; i++) {
      for (uint j = i+1; j < depositRanks.length; j++) {
        if (depositRanks[i].amount < depositRanks[j].amount) {
          DepositRank memory temp = depositRanks[i];
          depositRanks[i] = depositRanks[j];
          depositRanks[j] = temp;
        }
      }
    }
    return depositRanks;
  }
}
